CREATE TABLE plc_list (
    plc_id INT PRIMARY KEY AUTO_INCREMENT,
    plc_description JSON NOT NULL
);
CREATE TABLE plc_1 (
    plc_id INT,
    time DATETIME,
    temperature FLOAT,
    speed FLOAT,
    light FLOAT,
    angle FLOAT,
    PRIMARY KEY (plc_id, time),
    FOREIGN KEY (plc_id) REFERENCES plc_list(plc_id)
);
